const styles = () => ({
  bottomContainer: {
    justifyContent: 'space-between'
  },
  multiselectContainer: {
    display: 'flex'
  },
  viewLabel: {
    marginTop: '24px!important',
    fontWeight: 800,
    marginRight: '1.5rem',
  },
  paginationContainer: {
    display: 'flex',
    minWidth: '160px',
    alignItems: 'flex-end',
    flexDirection: 'column'
  }
});
  
export default styles;
